⚠️STATE CHAIR ELECTIONS⚠️

With the state chair and co-chair elections for @usapowerlifting_tx coming up, we want to use our platform to remind everyone to vote the week of December 17th!

Candidates Running for State Chair:

@bjjmark95 (owner of @texasbarbellsyndicate)
@wes_tss (owner of @texasstrengthsystems) with @mochu_26 for Co-Chair
@thekilocowboy with @little_salami for Co-Chair

This is probably the most amount of qualified candidates running for state chair and co-chair positions. Each candidate has something different they feel USAPL Texas needs more of, but they’re all here for the growth of the sport. The election gives you an opportunity to put who you feel will do the best job in this role. It’ll also show the national office that members actually care about who is being put in these positions rather than it just being a popularity contest.

Do your due diligence by doing some research on the candidates! Don’t forget to vote next week!
